Create a new Kotlin file and type this: import kweb.* fun main() { Kweb(port = 16097) { doc.body { h1().text("Hello World!") } }
} Run it, and then visit http://localhost:16097/ in your web browser to see the traditional greeting, translating to the following HTML body: <body> <h1>Hello World!</h1>
</body> This simple example already illustrates some important features of Kweb: Getting a kwebsite up and running is a breeze, no messing around with servlets, or third party webservers Your Kweb code will loosely mirror the structure of the HTML it generates

11.body:
One way to think of Kweb is as a domain-specific language (DSL) for building and manipulating a DOM in a remote web browser, while also listening for and handing DOM events. Importantly, this DSL can also do anything Kotlin can do, including features like for loops, functions, coroutines, and classes. Here is a simple example using an ordinary Kotlin for loop : Kweb(port = 16097) { doc.body { ul { for (x in 1..5) { li().text("Hello World $x!") } } }
} To produce... <body> <ul> <li>Hello World 1!</li> <li>Hello World 2!</li> <li>Hello World 3!</li> <li>Hello World 4!</li> <li>Hello World 5!</li> </ul>
</body> You can use functions for modularization and reuse: Kweb(port = 16097) { doc.body { ul { // We can modify the UL element we just created in an element {} block element { // Here we add a CSS class to the UL element classes("list") } // We can define functions as an extension to ElementCreator allowing us to use it // within the DSL fun ElementCreator<ULElement>.createMessage(x: Int) { li().text("Hello World $x!") } for (x in 1..5) { createMessage(x) } } }
} As you can see this is an extension function, which allows you to use the Kweb DSL within the newly created function. Don't worry if you're unsure about this because you can use IntelliJ's extract function refactoring to create these functions automatically.

