Let's create a <button> as a child of the <body> element and set its text: fun main() { Kweb(port = 16097) { doc.body { button().text("Click Me!") } }
} The Kweb DSL can be used to create nested elements: Kweb(port = 16097) { doc.body { table { tr { td().text("Name") td().text("Age") } tr { td().text("Alice") td().text("21") } tr { td().text("Bob") td().text("22") } } }
}

