You can attach event handlers to DOM elements: doc.body { val label = h1() label.text("Click Me") label.on.click { label.text("Clicked!") }
} Most if not all JavaScript event types are supported, and you can read event data like which key was pressed: doc.body { val input = input(type = InputType.text) input.on.keypress { keypressEvent -> logger.info("Key Pressed: ${keypressEvent.key}") }
}

25.body:
Sometimes you need to know the state of the DOM when an event is triggered. You could query it from within the event handler but this would add a server round trip which is inefficient. Alternatively you can use retrieveJs . This will execute the JavaScript expression you provide when the event fires and return the result in the retrieved property of the event: inputButton.on(retrieveJs = "(new Date()).getTime()").click { event -> label.text("Clicked at ${event.retrieved.jsonPrimitive.content}")
} For ValueElement s such as InputElement there is a convenience property valueJsExpression that you can use to retrieve the current value of the element: val textInput = input(type = InputType.text)
val inputButton = button(type = ButtonType.button)
val label = span().text("Not clicked")
inputButton.on(retrieveJs = textInput.valueJsExpression).click { event -> label.text("Read textInput: ${event.retrieved.jsonPrimitive.content}")
}

