You can also prevent the default action of an event from occurring by setting the preventDefault parameter to true - this is the equivalent of JavaScript's Event.preventDefault() function. val inputButton = button(type = ButtonType.button)
inputButton.on(preventDefault = true).click { logger.debug("Clicked!")
}

