First tell Kweb to use the Fomantic UI plugin: import kweb.plugins.fomanticUI.* fun main() { Kweb(port = 16097, plugins = listOf(fomanticUIPlugin)) { // ... }
} Now the plugin will add the Fomantic CSS and JavaScript code to your website automatically. Let's look at one of the simple examples from the Fomantic UI documentation: <div class="ui icon input"> <input type="text" placeholder="Search..."> <i class="search icon"></i>
</div> This translates to the Kotlin: import kweb.plugins.fomanticUI.*
import kweb.dom.element.creation.tags.InputType.* fun main() { Kweb(port = 16097, plugins = listOf(fomanticUIPlugin)4) { div(fomantic.ui.icon.input).new { input(type = text, placeholder = "Search...") i(fomantic.search.icon) } }
} Take a look at the Fomantic UI documentation to see everything else it can do.
